import { Link } from "react-router-dom";

const Apple = () => {
  return (
    <div>

      <h1>りんごでログインしています</h1>
      <div>
        ログインは<Link to={`/login/`}>こちら</Link>
      </div>
      <div>
        <Link to={`/`}>ホームに戻る</Link>
      </div>
    </div>
  );
};

export default Apple;
